function padTime( $timeString ) {

return str_pad($timeString, 2, "0", STR_PAD_LEFT ) ;
}

function dateConvert($x_date){
		$x_date = explode('/', $x_date, 4);
		$x_months = array('','January','Feburary', 'March', 'April', 'May', 'June', 'July', 'August', 'September', 'October', 'November', 'December');
 
		$x_month = intval($x_date[0]);
		$x_day = intval($x_date[1]);
		$x_year = $x_date[2];
		return ($x_months[$x_month]." ".$x_day. ", ".$x_year);
	}

